import React, { } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/pagination';
import './reset.css';
import "./App.css"
// import required modules
import { Pagination } from 'swiper/modules';

import Page1 from "./10_Mainpage/sub/Page1"
import Page2 from "./10_Mainpage/sub/Page2"
import Interest from "./20_Interest/Interset"
import Roadmap from './30_Roadmap/Roadmap';

import Modal from "./20_Interest/sub/Modal"

export default function App() {


  return (
    <>
      <Swiper
        pagination={{
          dynamicBullets: true,
          clickable: true,

        }}
        modules={[Pagination]}
        className="mySwiper"

      >
        <SwiperSlide className="swiperSlide"><Page1 /></SwiperSlide>
        <SwiperSlide className="swiperSlide"><Page2 /></SwiperSlide>
        <SwiperSlide className="swiperSlide"><Modal pic={Guitar} /></SwiperSlide>
        <SwiperSlide><Interest /></SwiperSlide>
        <SwiperSlide><Roadmap /></SwiperSlide>
      </Swiper>
    </>
  );
}
